INSERT INTO cga105g2.article (MEM_ID, STORE_ID, ART_HEADER, ART_TEXT, ART_IMG, ART_SCORE)
VALUES (1, 6,"服務","這家的地理位置無論是桃園、八德、鶯歌的居民
來這邊都不遠(⁎⁍̴̛ᴗ⁍̴̛⁎)
小小一家但是裝潢和環境都很舒適
不會有擁擠感～
那天是下大雨天過去，生意依舊很好🤩
食材都在水準之上
連副餐的優格和沙拉的菜都很好吃😋
好希望我家附近也有那麼棒的早午餐店🤪
-
店名：日日十辰
地址：新北市鶯歌區鶯歌路158號
-
🔹品名：皇后早午餐（味噌霜降究好豬）/價錢：430

內容物超豐富！
內有：味噌豬、炒蛋、香蒜麵包、優格、沙拉（佐胡麻醬）、飲品

味噌豬每一塊都有厚度，比較紮實
而且調味剛剛好🤤
優格、沙拉都很好吃！清爽不負擔😋
這盤很適合給大食量者享用
我真的吃不完會很撐🤣🤣🤣

🔹品名：班尼迪克兄弟/價錢：290

這道大推👍
班尼迪克蛋有兩顆🥰
一顆配火腿、一顆配燻鮭魚
好愛燻鮭魚的部分🤩

奶油炒菇有添加胡椒鹽
調味蠻好吃的，比較重口味～
值得一提的是，生菜的部分非常新鮮清脆
搭配凱薩醬吃起來很清爽
還有附贈薯條🍟
份量吃起來剛剛好

🔹品名：抹茶拿鐵（無糖去冰）/價錢：150
🔹品名：拿鐵（無糖、熱）/價錢：130
（套餐加購飲品折$40）

抹茶拿鐵是抹茶加上拿鐵☕️
不是抹茶鮮奶喔！！（要喝抹茶鮮奶要點抹茶歐蕾）
我本來就愛苦抹茶🍵
他們家的抹茶真的有苦🤩
拿鐵也算濃郁，不會稀稀的～", ,4);
